import React, { useState } from "react";
import {
  Box,
  Center,
  Stack,
  Flex,
  ActionIcon,
  Autocomplete,
  rem,
  Avatar,
  Text,
  Button,
} from "@mantine/core";
import {
  IconHome2,
  IconUser,
  IconMessageCircle,
  IconBookmark,
  IconAlignLeft,
  IconSearch,
  IconCircleXFilled,
  IconBell,
} from "@tabler/icons-react";

const ResponsivePhone = () => {
  const [selectedBlackIcon, setSelectedBlackIcon] = useState(null);

  const handleBlackIconClick = (index, component) => {
    console.log("Clicked icon :", component);
    setSelectedBlackIcon(index);
  };

  const blackicons = [
    { name: "IconHome2", component: <IconHome2 /> },
    { name: "IconMessageCircle", component: <IconMessageCircle /> },
    { name: "IconBookmark", component: <IconBookmark /> },
    { name: "IconUser", component: <IconUser /> },
  ];

  return (
    <Stack>
      <Center>
        <Box
          className="responsive-phone"
          style={{
            position: "relative",
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            // width: "100%",
            maxWidth: "250px",
            width: "250px",
            height: "500px",
            backgroundColor: "#ffffff",
            border: "2px solid #1b1c1b",
            borderRadius: "18px",
            boxShadow: "5px 5px 10px rgba(0, 0, 0, 0.2)",
          }}
        >
          {/* Top Box */}
          <Box
            bg="dark.9"
            style={{
              width: "100%",
              height: "30px",
              borderRadius: "15px 15px 0px 0px",
            }}
          >
            <Center mt="xs">
              <Box
                bg="white"
                style={{
                  width: "50px",
                  height: "5px",
                  borderRadius: "15px 15px 15px 15px",
                }}
              />
            </Center>
          </Box>

          {/* Center Box (Takes the remaining space) */}
          <Box
            bg="light.2"
            style={{
              flex: 1,
              width: "100%",
              marginTop: "-2px",
              marginBottom: "-2px",
              border: "2px solid #000",
              // borderRadius: "15px 15px 15px 15px",
              display: "flex",
              flexDirection: "column",
            }}
          >
            {/* <Flex
                mih={50}
                bg="gray.2"
                justify="space-around"
                align="center"
                direction="row"
                wrap="wrap"
                style={{
                  padding: "10px",
                }}
              >
                <IconAlignLeft style={{ marginLeft: "4px" }} />
                <Autocomplete
                  placeholder="Search"
                  leftSection={
                    <IconSearch
                      style={{ width: rem(16), height: rem(16) }}
                      stroke={1.5}
                    />
                  }
                  visibleFrom="xs"
                  radius="lg"
                />
                <Avatar bg="white" radius="xl">
                  <IconBell />
                </Avatar>
              </Flex> */}
            <Box
              bg="gray.2"
              style={{
                width: "100%",
                height: "50px",
                backgroundColor: "#ffffff",
                borderBottom: "1px solid #1b1c1b",
              }}
            >
              <Flex
                mih={50}
                gap="xs"
                justify="center"
                align="center"
                direction="row"
                wrap="wrap"
              >
                <IconAlignLeft />
                <Box
                  bg="gray.1"
                  style={{
                    width: "150px",
                    height: "30px",
                    backgroundColor: "#ffffff",
                    border: "1px solid #1b1c1b",
                    borderRadius: "15px",
                  }}
                >
                  <Flex
                    // mih={50}
                    // bg="rgba(0, 0, 0, .3)"
                    gap="xs"
                    justify="flex-start"
                    align="center"
                    direction="row"
                    wrap="wrap"
                  >
                    <IconSearch
                      style={{ width: rem(16), height: rem(16) }}
                      stroke={1.5}
                    />
                    <Text>Search</Text>
                  </Flex>
                </Box>
                <Avatar bg="white" radius="xl">
                  <IconBell />
                </Avatar>
              </Flex>
            </Box>

            <Box style={{ flex: 1, background: "white" }} />

            <Flex
              mih={50}
              bg="dark.9"
              justify="space-around"
              align="center"
              direction="row"
              wrap="wrap"
              style={{
                padding: "10px",
              }}
            >
              {blackicons.map((blackicon, index) => (
                <ActionIcon
                  bg="black"
                  radius="md"
                  key={index}
                  variant={selectedBlackIcon === index ? "transparent" : ""}
                  aria-label={`Icon ${blackicon.component}`}
                  onClick={() => handleBlackIconClick(index, blackicon)}
                >
                  {blackicon.component}
                </ActionIcon>
              ))}
            </Flex>
          </Box>

          {/* Bottom Box (Positioned at the bottom) */}
          <Box
            bg="dark.9"
            style={{
              width: "100%",
              height: "30px",
              borderRadius: "0px 0px 15px 15px",
            }}
          >
            <Center mt="xs">
              <Box
                bg="white"
                style={{
                  width: "50px",
                  height: "5px",
                  borderRadius: "15px 15px 15px 15px",
                }}
              />
            </Center>
          </Box>
        </Box>
      </Center>
    </Stack>
  );
};

export default ResponsivePhone;
